class Connexion extends Component {
    render() {
        return (
            <div className='vh-100 vw-100 container-xl'>
                <div className="row">
                    <div className="col-md-6">

                    </div>
                    <div className="col-md-6">
                        <h1 className="">Sign in to Clever</h1>
                    </div>
                </div>
            </div>
        );
    }
}

export default Connexion;
